PetscErrorCode GetGeometricTensor(const IGAPoint pnt)
{
  IGAPointFormInvGradGeomMap(pnt,&St.InvGradMap[0][0]); // Inverse mapping
  St.G00 = St.InvGradMap[0][0] * St.InvGradMap[0][0] + St.InvGradMap[0][1] * St.InvGradMap[0][1];
  St.G01 = St.InvGradMap[0][0] * St.InvGradMap[1][0] + St.InvGradMap[0][1] * St.InvGradMap[1][1];
  St.G10 = St.InvGradMap[1][0] * St.InvGradMap[0][0] + St.InvGradMap[1][1] * St.InvGradMap[0][1];
  St.G11 = St.InvGradMap[1][0] * St.InvGradMap[1][0] + St.InvGradMap[1][1] * St.InvGradMap[1][1];
  return 0;
}

PetscErrorCode UnpackSol(const AppCtx *user,PetscScalar *sol,PetscScalar *sol_t,PetscScalar (*grad_sol)[DIM],PetscScalar (*hess_sol)[DIM][DIM])
{
  St.rho = sol[0];
  St.u1 = sol[1];
  St.u2 = sol[2];
  if(user->Energy)  St.T = sol[3];
  if(!user->Energy) St.T = user->theta;
  St.aux = sol[user->dof-1];
  St.u_norm2 = SQ(St.u1) + SQ(St.u2);
  St.rho_t = sol_t[0];
  St.u1_t = sol_t[1];
  St.u2_t = sol_t[2];
  if(user->Energy)  St.T_t = sol_t[3];
  St.rho_1 = grad_sol[0][0];
  St.rho_2 = grad_sol[0][1];
  St.u1_1 = grad_sol[1][0];
  St.u1_2 = grad_sol[1][1];
  St.u2_1 = grad_sol[2][0];
  St.u2_2 = grad_sol[2][1];
  if(user->Energy){
  St.T_1 = grad_sol[3][0];
  St.T_2 = grad_sol[3][1];
  }
  St.aux_1 = grad_sol[user->dof-1][0];
  St.aux_2 = grad_sol[user->dof-1][1];
  St.rho_11 = hess_sol[0][0][0];
  St.rho_12 = hess_sol[0][0][1];
  St.rho_21 = hess_sol[0][1][0];
  St.rho_22 = hess_sol[0][1][1];
  St.u1_11 = hess_sol[1][0][0];
  St.u1_12 = hess_sol[1][0][1];
  St.u1_21 = hess_sol[1][1][0];
  St.u1_22 = hess_sol[1][1][1];
  St.u2_11 = hess_sol[2][0][0];
  St.u2_12 = hess_sol[2][0][1];
  St.u2_21 = hess_sol[2][1][0];
  St.u2_22 = hess_sol[2][1][1];
  if(user->Energy){
  St.T_11 = hess_sol[3][0][0];
  St.T_12 = hess_sol[3][0][1];
  St.T_21 = hess_sol[3][1][0];
  St.T_22 = hess_sol[3][1][1];
  }
  return 0;
}

