  R[St.a][1] += St.kappa_DC_M*(St.N1_a_1*St.rho_1*St.u1+St.N1_a_2*St.rho_2*St.u1+St.N1_a_1*St.rho*St.u1_1+St.N1_a_2*St.rho*St.u1_2);
