  St.Res_Strong_2 += user->sigma * (St.u2 - user->u_BC[1]);
  if (user->Energy) St.Res_Strong_3 += user->sigma * (St.T - user->T_inlet);
  St.Res_Strong_0 /= (1.0 + user->sigma);
